import { combineReducers } from 'redux';
import listTodo from '../reducer/listTodo';
import filterItems from '../reducer/filterItems';
import loadingTodo from '../reducer/loadingTodo';
import selectedItem from '../reducer/selectedItem';

const rootReducer = combineReducers({
    list: listTodo,
    filter: filterItems,
    loading: loadingTodo,
    selectedItem: selectedItem,
  });
  
  export default rootReducer;
